import { Chart, Axis, Tooltip, Polygon } from 'viser-react';
import * as React from 'react';
import * as $ from 'jquery';
const DataSet = require('@antv/data-set');


const data = [
  { year: '1991', value: 3 },
  { year: '1992', value: 4 },
  { year: '1993', value: 3.5 },
  { year: '1994', value: 5 },
  { year: '1995', value: 4.9 },
  { year: '1996', value: 6 },
  { year: '1997', value: 7 },
  { year: '1998', value: 9 },
  { year: '1999', value: 13 },
];

class Reactjs extends React.Component {

    render() {
        const scale = [
            {
                dataKey: 'name',
                type: 'cat',
                values: ['Alexander', 'Marie', 'Maximilian', 'Sophia', 'Lukas', 'Maria', 'Leon', 'Anna', 'Tim', 'Laura']
            },
            {
                dataKey: 'day',
                type: 'cat',
                values: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday']
            }
        ];
        return (
            <Chart data={data} forceFit height={500} padding={[20, 80, 120, 85]} scale={scale}>


                <Tooltip />
                <Polygon
                    position="name*day"
                    color={['sales', '#f6f6f6-#36B3C3']}
                    label={[
                        'sales',
                        {
                            offset: -2,
                            textStyle: {
                                fill: '#fff',
                                shadowBlur: 2,
                                shadowColor: 'rgba(0, 0, 0, .45)'
                            }
                        }
                    ]}
                    style={{
                        lineWidth: 1,
                        stroke: '#fff'
                    }}
                />
            </Chart>
        );
    }
}
export default Reactjs
